import React from 'react'
import bootstrap from 'bootstrap';
import nav_image from './components/images/\nav-image.png';
const Nav = () => {
  return (
    <nav className='container-fluid row main-nav'>
        <div className='nav-logo'>
            <a href='#'><img src={nav_image} alt='hello'/></a>
        </div>
        <div className='page-names'>
            <ul className='page-list' >
                <li className='categories'><a href='#'>Categories</a></li>
                <li className='products'><a href='#'>Products</a></li>
                <li className='cart'><a href='#'>Cart</a></li>
            </ul>
        </div>
    </nav>
  )
}
export default Nav;
